func TestMessageType_Name(t *testing.T) {

	type Case struct {
		Type         P2PMessageType
		ExpectedName interface{}
		OK           bool
	}

	cases := []Case{
		{Type: HandshakeMessageType, ExpectedName: "Handshake", OK: true},
		{Type: GoAwayMessageType, ExpectedName: "GoAway", OK: true},
		{Type: TimeMessageType, ExpectedName: "Time", OK: true},
		{Type: NoticeMessageType, ExpectedName: "Notice", OK: true},
		{Type: RequestMessageType, ExpectedName: "Request", OK: true},
		{Type: SyncRequestMessageType, ExpectedName: "SyncRequest", OK: true},
		{Type: SignedBlockType, ExpectedName: "SignedBlock", OK: true},
		{Type: PackedTransactionMessageType, ExpectedName: "PackedTransaction", OK: true},
		{Type: P2PMessageType(100), ExpectedName: "Unknown", OK: false},
	}

	for _, c := range cases {

		name, ok := c.Type.Name()
		assert.Equal(t, c.OK, ok)
		assert.Equal(t, c.ExpectedName, name)
	}
}

func TestDecoder_P2PMessageEnvelope(t *testing.T) {

	buf := new(bytes.Buffer)
	enc := NewEncoder(buf)

	msg := &P2PMessageEnvelope{
		Length:  4,
		Type:    PackedTransactionMessageType,
		Payload: []byte{1, 2, 3},
	}

	err := enc.Encode(msg)
	assert.NoError(t, err)
	d := NewDecoder(buf.Bytes())

	var decoded P2PMessageEnvelope

	d.DecodeP2PMessage(false)
	err = d.Decode(&decoded)
	assert.NoError(t, err)
	assert.Equal(t, uint32(4), decoded.Length)
	assert.Equal(t, PackedTransactionMessageType, decoded.Type)
	assert.Equal(t, []byte{1, 2, 3}, decoded.Payload)
}

func TestDecoder_P2PMessageEnvelope_WrongType(t *testing.T) {

	buf := new(bytes.Buffer)
	enc := NewEncoder(buf)

	msg := &P2PMessageEnvelope{
		Length:  4,
		Type:    99,
		Payload: []byte{1, 2, 3},
	}

	err := enc.Encode(msg)
	assert.NoError(t, err)
	d := NewDecoder(buf.Bytes())

	var decoded P2PMessageEnvelope

	err = d.Decode(&decoded)
	assert.EqualError(t, err, "decode, unknown p2p message type [99]")
}

func TestDecode_OptionalProducerSchedule_Missing_PresentByte(t *testing.T) {

	decoder := NewDecoder([]byte{})
	err := decoder.Decode(&OptionalProducerSchedule{})
	assert.EqualError(t, err, "decode: OptionalProducerSchedule isPresent, byte required [1] byte, remaining [0]")

}

func TestDecode_P2PMessageEnvelope_bad_data(t *testing.T) {

	buf := new(bytes.Buffer)

	decoder := NewDecoder([]byte{})
	err := decoder.Decode(&P2PMessageEnvelope{})
	assert.EqualError(t, err, "decode, p2p envelope length: uint32 required [4] bytes, remaining [0]")

	encoder := NewEncoder(buf)
	encoder.writeUint32(4)

	decoder = NewDecoder(buf.Bytes())
	err = decoder.Decode(&P2PMessageEnvelope{})
	assert.EqualError(t, err, "decode, p2p envelope type: byte required [1] byte, remaining [0]")

	buf = new(bytes.Buffer)
	encoder = NewEncoder(buf)
	encoder.writeUint32(10)
	encoder.writeByte(9)

	decoder = NewDecoder(buf.Bytes())
	err = decoder.Decode(&P2PMessageEnvelope{})
	assert.EqualError(t, err, "decode, p2p envelope payload required [10] bytes, remaining [0]")

}

